import React from "react";

const ReadOnlyRow = ({ contact, index, handle }) => {
    return (
        <tr>
            <td>{index + 1}</td>
            <td>{contact.fullName}</td>
            <td>{contact.address}</td>
            <td>{contact.phoneNumber}</td>
            <td>{contact.email}</td>
        </tr>
    );
};

export default ReadOnlyRow;
